import React from 'react';
import { Title } from './components/component';
import './App.css';

class App extends React.Component {
  
  render() {
    return (
      <div>
        <header className="App-header">
          Hello
          <Title title = "Title"/>
        </header>
      </div>
    )
  }
}

export default App;
